import { createTheme } from '@mui/material/styles';

const theme = createTheme({

    palette: {
        primary: {
            main: '#3f51b5',
        },
        secondary: {
            main: '#f50057',
        },
        background: {
            paper: '#f1ceff',
        },
        text: {
            primary: '#003a75',
            disabled: '#93b1c8',
            secondary: '#ffffff',
        },
    },
    typography: {
        fontFamily: 'DIN, Roboto, sans-serif',
        fontWeight: 'bold',
        fontSize: '24px',
        textAlign: 'center',
        padding: '10px',
        color: '#6BF3BF',
        backgroundColor: '#003971',
        height: '64px',
    },
    components: {
        MuiAppBar: {
            styleOverrides: {
                root: {
                    margin: 'auto',
                    fontFamily: 'DIN, Roboto, sans-serif',
                    fontWeight: 'bold',
                    fontSize: '24px',
                    textAlign: 'center',
                    padding: '10px',
                    color: '#6BF3BF',
                    backgroundColor: '#003971',
                    height: '64px',
                },
            },
        },
        MuiCssBaseline: {
            styleOverrides: {
                '@global': {
                    '@font-face': DINFont, // add @font-face rule to load DIN font
                },
            },
        },
    },
});

export default theme;
